import React from 'react'
import SearchMeds from './SearchMeds'


export function SelectedMedsList(props) {
    const { selectedMeds } = props

    return (
        <div>
            { selectedMeds.map(med => <h3>{med.name}</h3>)}
        </div>
    )
}
